module.exports = "<div class=\"container\" scrollY=\"true\">\r\n  <div class=\"content-page\">\r\n\r\n    <!-- Fermeture de la modal -->\r\n    <div class=\"close\" (click)=\"closeModal()\">\r\n      X\r\n    </div>\r\n    <ion-item></ion-item>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      Dans cette rubrique, vous avez accès aux informations suivantes :\r\n      Mentions légales (I); Protection des données personnelles (II) ;\r\n      Utilisation des cookies (III) que  nous vous conseillons de parcourir intégralement.\r\n    </ion-text>\r\n    <br/>\r\n    <br/>\r\n    <ion-label class=\"title-block\" style=\"color: #633ce0\">\r\n      I -  <strong><u>\r\n        MENTIONS LÉGALES\r\n      </u></strong>\r\n    </ion-label>\r\n    <br/>\r\n    <br/>\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u> Société</u> : </strong>\r\n    </ion-label>\r\n    <br/>\r\n\r\n    <ion-text class=\"mt-2 text-block-style\">\r\n      <li>\r\n        <strong> AfriClean Services SAS</strong>, au capital de GNF 70.000.000\r\n      </li>\r\n      <li>\r\n        <strong><u>N° RCCM :</u></strong> GN.TCC.2021.B.02738\r\n      </li>\r\n      <li>\r\n        <strong><u> Numéro d'Identification Fiscal (NIF)</u> :</strong> 790248744\r\n      </li>\r\n      <li>\r\n        <strong><u> Numéro TVA</u> :</strong> ...\r\n      </li>\r\n\r\n      <li>\r\n        <strong><u>Siège social</u> : </strong> Kaporo Rails, Commune de Ratoma (Guinée)\r\n      </li>\r\n      <li>\r\n        <strong><u> Tél </u> :</strong> +224 626 85 32 72\r\n      </li>\r\n      <li>\r\n        <strong><u> Mail</u> :</strong> <span style=\"color: blue\"><i> contact@africlean-services.com </i></span>\r\n      </li>\r\n\r\n\r\n    </ion-text>\r\n\r\n    <br>\r\n    <br>\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>Responsable de la publication </u> :</strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      Monsieur Amadou Mounir DIALLO, <strong>Président</strong>\r\n    </ion-text>\r\n\r\n    <br/>\r\n    <br/>\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>Hébergeur </u>:</strong>\r\n    </ion-label>\r\n    <br/>\r\n\r\n    <ion-text class=\"mt-2 text-block-style\">\r\n      <strong>Dénomination sociale : </strong> Amazon (Amazon Web Services) <br/>\r\n      <strong>Siège social de l'hébergeur : </strong> Seattle, Washington, États-Unis <br/>\r\n      <strong>Contact : </strong>\r\n       <span class=\"link-style\"><a\r\n            href=\" https://aws.amazon.com/fr/contact-us/?nc1=f_m\"> https://aws.amazon.com/fr/contact-us/?nc1=f_m\r\n       </a> </span> <br/>\r\n      <strong>Numéro RCS Paris : </strong> Nanterre B 831 001 334 <br/>\r\n    </ion-text>\r\n    <br/>\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong> <u>Éditeurs :</u></strong>\r\n    </ion-label>\r\n    <br/>\r\n    <ion-text class=\"mt-2 text-block-style\">\r\n      <strong>Monsieur BAH Mamadou Aliou </strong>, 2 allée des forsythias, 33600 Pessac (France)<br/>\r\n      <strong> Monsieur DIALLO Thierno Malal</strong> , 10 rue Raymond Poincaré, 94000 Créteil (France) <br/>\r\n    </ion-text>\r\n    <br/>\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>Délégué à la protection des données (DPO)</u>:</strong>\r\n    </ion-label>\r\n    <br/>\r\n    <ion-text class=\"text-block-style\">\r\n      Les données personnelles vous concernant sont destinées\r\n      à AfriClean et/ou à ses sous-traitants. Vous disposez d'un droit d'accès, de\r\n      rectification et de suppression de  vos données personnelles en nous écrivant à l'adresse mail suivant:\r\n      <span style=\"color: blue\"><i> contact@africlean-services.com </i></span><br>\r\n    </ion-text>\r\n    <ion-text class=\"text-block-style\">\r\n      Toute demande de rectification ou de suppression doit être accompagnée d’un justificatif d’identité.<br/>\r\n      <strong><u> DPO</u> :</strong>  Monsieur Amadou Mounir DIALLO\r\n\r\n    </ion-text>\r\n\r\n<br/><br/>\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>Propriété intellectuelle </u>:</strong>\r\n    </ion-label>\r\n    <br/>\r\n    <ion-text class=\"text-block-style\">\r\n      Certains signes distinctifs, propriété d'AfriClean, notamment les marques, dessins et\r\n      logos sont protégés par des droits de propriété intellectuelle. Toute reproduction,\r\n      imitation et/ou exploitation partielle ou totale de ces signes distinctifs,\r\n      sans l'autorisation écrite d'AfriClean, est strictement interdite.<br>\r\n    </ion-text>\r\n\r\n\r\n<ion-item></ion-item>\r\n    <br/>\r\n    <ion-label class=\"title-block\" style=\"color: #633ce0\">\r\n      II -  <strong><u>\r\n      PROTECTION DES DONNÉES PERSONNELLES\r\n    </u></strong>\r\n    </ion-label>\r\n    <br/>\r\n    <ion-text class=\"text-block-style\">\r\n      AfriClean Services (ci-après- AfriClean) place la protection des données à caractère personnel\r\n      de ses clients et utilisateurs du Compte AfriClean au cœur de sa politique de confidentialité\r\n      et de traitement. Celle-ci s’applique à tous les services d'AfriClean.\r\n      Une donnée personnelle ou une donnée à caractère personnel désigne toute information relative\r\n      à vous (personne physique) et qui permet de vous identifier directement ou indirectement.\r\n    </ion-text>\r\n    <br/>\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Base légale du traitement de vos données\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n    <ion-text class=\"text-block-style\">\r\n      La base légale des traitements effectués par l'Editeur du Site AfriCleanServices est, soit :\r\n      <li>\r\n        Ce traitement relève de la formation et de l'exécution du contrat de\r\n        prestation relatif au ramassage des déchets ménagers ainsi\r\n        que le nettoyage des locaux à usage professionnel et/ou privé.\r\n      </li>\r\n      <li>\r\n        Ce traitement relève également de l'acceptation claire des\r\n        utilisateurs pour recevoir d'offres personnalisées.\r\n      </li>\r\n    </ion-text>\r\n    <br>\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Finalités du traitement de vos données\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n    <ion-text class=\"text-block-style\">\r\n      Le traitement a pour objet de gérer le Compte AfriClean par lequel des services sont\r\n       proposés aux clients et/ou utilisateurs d'Africlean. Il permet à AfriClean :\r\n      <li>\r\n        d’assurer l’inscription et l’authentification des utilisateurs aux services du Compte AfriClean,\r\n      </li>\r\n      <li>\r\n        de permettre la navigation des utilisateurs du Compte AfriClean et d'améliorer cette navigation,\r\n      </li>\r\n      <li>\r\n        de mettre des services AfriClean à disposition des utilisateurs et d’en assurer le bon fonctionnement,\r\n      </li>\r\n      <li>\r\n        garantir le suivi et le traitement des demandes et réclamations des utilisateurs,\r\n      </li>\r\n      <li>\r\n        de communiquer avec les utilisateurs,\r\n      </li>\r\n      <li>\r\n        de produire des statistiques sur l’utilisation des services AfriClean.\r\n      </li>\r\n    </ion-text>\r\n    <br>\r\n\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Catégories des données traitées\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      Les données traitées peuvent porter sur des :\r\n      <li>\r\n        Données d’identification des utilisateurs comme nom, prénom, identifiant, mot de passe et adresse\r\n        électronique,\r\n      <li>\r\n        Données d’utilisation du Site telles que adresse IP, navigateur utilisé, système d’exploitation, dates,\r\n        horaires et temps de connexion sur le Site; données d’authentification collectées au moyen de cookies,\r\n      </li>\r\n\r\n      <li>\r\n        Données nécessaires à l'utilisation des services d'AfriClean par le client,\r\n      </li>\r\n      <li>\r\n        Échanges entre AfriClean et ses clients,\r\n      </li>\r\n      <li>\r\n        Échanges entre AfriClean et ses prestataires.\r\n      </li>\r\n      <li>\r\n        échanges entre AfriClean et ses prestataires, sous-traitants.\r\n      </li>\r\n\r\n    </ion-text>\r\n    <br>\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Provenance des données traitées\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      Ces informations sont recueillies auprès de l'utilisateur du Compte AfriClean aussi bien lors de\r\n      sa création que lors de l’utilisation des Services d’AfriClean.<br/>\r\n      AfriClean prévoit le recueil obligatoire des données qui sont nécessaires à la gestion technique\r\n      du Compte et des services et d’exécution des services.<br/>\r\n      AfriClean collecte également des données nécessaires à la gestion administrative et organisationnelle\r\n      de son personnel interne.\r\n    </ion-text>\r\n    <br>\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Personnes concernées par le traitement\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      Le traitement de données concerne :\r\n      <li>\r\n        les utilisateurs (clients) qui créent un Compte pour accéder aux services d'AfriClean,\r\n      <li>\r\n      les utilisateurs (personnels) de la société AfriClean et de sous-traitants en\r\n      charge de la gestion du Compte AfriClean.\r\n      </li>\r\n    </ion-text>\r\n    <br>\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Destinataires de vos données\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      En fonction des besoins respectifs, sont destinataires de tout ou partie des données,\r\n      les personnels de la société AfriClean et les sous-traitants en charge de la gestion du Compte AfriClean\r\n      notamment pour héberger les données collectées.\r\n    </ion-text>\r\n    <br>\r\n\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Transferts de vos données à l'étranger\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      Pour des raisons de logistique et de prestations spécifiques notamment pour l'hébergement\r\n      des données, AfriClean peut avoir recours à des sous-traitants établis en dehors\r\n      de la Guinée et dans des pays tiers (hors espace CEDEAO).\r\n    </ion-text>\r\n    <br>\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Durée de conservation des données\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      Ces données seront conservées jusqu’à la fin de l’utilisation des services par l'utilisateur et\r\n      de l’expiration des délais de prescription.\r\n    </ion-text>\r\n    <br>\r\n\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Sécurité des données traitées\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      AfriClean met en œuvre des mesures de sécurité pour empêcher notamment que vos données ne soient\r\n      endommagées, effacées ou que des tiers non autorisés y aient accès.\r\n      <br>\r\n      En cas d’incident de sécurité affectant vos données personnelles (destruction, perte, altération\r\n      ou divulgation), AfriClean s’engage à prendre toutes les mesures nécessaires afin d’y remédier.\r\n      À la survenance d’un tel incident, AfriClean vous informe et signale l'incident à l'Autorité de\r\n      Protection dans les délais impartis.\r\n    </ion-text>\r\n    <br>\r\n\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Vos droits de recours\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      Vous pouvez accéder et obtenir copie des données vous concernant, vous opposer au traitement\r\n      de ces données, les faire rectifier ou les faire effacer. Vous disposez également\r\n      d'un droit à la limitation du traitement de vos données ainsi que le droit à\r\n      la portabilité de vos données collectées, sous réserve de remplir certaines conditions.\r\n    </ion-text>\r\n    <br>\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Exercice de vos droits\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      Le responsable du traitement des données vous concernant est la société AfriClean qui a désigné\r\n      un Délégué à la Protection des Données (DPO): Monsieur Amadou Mounir DIALLO\r\n      <br>\r\n      Toute demande d'exercice de vos droits sur ce traitement peut lui être adressée à l’adresse mail suivante :\r\n      <span class=\"link-style\">contact@africlean-services.com</span>\r\n      <br>\r\n      Pour exercer ses droits, l'utilisateur devra justifier de son identité. AfriClean s’engage\r\n      à répondre à ses demandes d’exercice de ses\r\n      droits dans les meilleurs délais et en tout état de cause dans le respect des délais légaux.\r\n    </ion-text>\r\n    <br>\r\n\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Réclamation (plainte) auprès de l'Autorité de Protection\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      Si vous estimez, après avoir contacté AfriClean, que vos droits sur vos données ne sont pas\r\n      respectés, vous pouvez adresser une réclamation à l'Autorité de Protection à l'adresse suivante:…\r\n    </ion-text>\r\n\r\n    <ion-item></ion-item>\r\n    <br/>\r\n    <br/>\r\n\r\n    <ion-label class=\"title-block\" style=\"color: #633ce0\">\r\n      III - <strong><u>\r\n        UTILISATION DE COOKIES PAR AFRICLEAN\r\n      </u></strong>\r\n    </ion-label>\r\n    <br/>\r\n    <br/>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      AfriClean utilise des cookies pour fournir à l'utilisateur du Compte AfriClean\r\n      une expérience utilisateur optimale et adaptée à ses préférences personnelles.\r\n      L’Utilisateur peut faire le choix d’accepter ou de REFUSER les cookies. Un cookie désigne\r\n      un petit fichier informatique, un traceur qui permet d'analyser le comportement de l'Utilisateur\r\n      lors de la visite du site AfriClean ou de son application mobile.\r\n      <br>\r\n      <strong> Définition d'un cookie : </strong> &nbsp; Un cookie désigne un petit fichier informatique, un\r\n      traceur qui permet d'analyser le comportement de l'Utilisateur lors de la visite du site AfriFlash.\r\n      <br>\r\n    </ion-text>\r\n    <br>\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Les différents cookies utilisés\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n\r\n      <strong>Les cookies techniques de navigation: </strong>  Ils permettent d'optimiser la performance\r\n      du site internet et l'application mobile Compte AfriClean. Si vous avez choisi de désactiver\r\n      ces cookies via votre navigateur internet, l’accès à nos services pourrait alors se révéler altéré.\r\n      Nous vous conseillons donc de les laisser actifs pour profiter pleinement de nos services et de\r\n      votre navigation sur notre site et application.\r\n\r\n      <br>\r\n      <strong>Le cookie de mesure d’audience et de suivi de navigation: </strong> &nbsp;Il permet de collecter des\r\n      données statistiques anonymes de fréquentation du site AfriClean\r\n      afin d’améliorer son ergonomie. Il nécessite le consentement de l'utilisateur.\r\n      <br>\r\n\r\n      <strong>Les cookies de publicité ciblée: </strong> Déposés par AfriClean, ils permettent de proposer\r\n      à l’utilisateur des publicités adaptées à ses   centres d'intérêts. Ils nécessitent le consentement\r\n      de l'utilisateur.\r\n      <br>\r\n      <strong>Les cookies de bouton de partage sur les réseaux sociaux: </strong> &nbsp; Déposés sur le\r\n      terminal de l’utilisateur par des sites de réseaux sociaux, ils permettent le partage de contenus\r\n      de nos services. AfriClean n'a aucun contrôle sur ces cookies et les données récoltées par\r\n      ces réseaux sociaux. Pour plus d’informations sur ces cookies, nous vous invitons à\r\n      consulter la politique de confidentialité propre à chacun de ces sites de réseaux sociaux.\r\n      <br>\r\n    </ion-text>\r\n    <br>\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Durée de validité des cookies\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      <strong><u>Les cookies de publicité ciblée et de mesure d’audience </u></strong> ont une durée de validité de 13 mois maximum. Le\r\n      consentement de l’Utilisateur sera de nouveau sollicité à l’issue de ce délai par l’affichage de la fenêtre\r\n      intruse (pop-up) d’information.\r\n      <br>\r\n      <strong><u>Les cookies techniques de navigation</u></strong> expirent automatiquement lorsque l'Utilisateur ferme son navigateur.\r\n    </ion-text>\r\n    <br>\r\n\r\n    <ion-label class=\"title-block\">\r\n      <strong><u>\r\n        Désactivation des cookies:\r\n      </u></strong>\r\n    </ion-label>\r\n    <br>\r\n\r\n    <ion-text class=\"text-block-style\">\r\n      Vous conservez la faculté de désactiver les cookies à tout moment.\r\n    </ion-text>\r\n    <br>\r\n\r\n    <ion-item>\r\n\r\n    </ion-item>\r\n  </div>\r\n</div>\r\n"

