module.exports = "<div class=\"content-page\">\r\n    <!-- Le titre du component -->\r\n    <div class=\"header\" *ngIf=\"action == 'update'\"\r\n         style=\"display: flex!important; flex-direction: row!important; justify-content: space-between!important;\">\r\n        <span>Modification d'une prospection</span>\r\n        <span class=\"close-modal\" *ngIf=\"( action ==='update')\" (click)=\"closeModal()\"\r\n              style=\"margin-right: 1rem!important;\">X</span>\r\n    </div>\r\n    <div *ngIf=\"prospections &&  action !=='update'\" [ngClass]=\"(isWeb) ? 'filter-block' : 'filter_block-mobile'\"\r\n         style=\" background: #d7efda;margin-left: 0!important; width: 95vw!important;\">\r\n        <div *ngIf=\"prospections && prospections.length>0 && action != 'update'\" (click)=\"showFiltres()\"\r\n             class=\"filter-item-style\">\r\n            <ion-icon ios=\"ios-funnel\" md=\"md-funnel\"\r\n                      style=\"color:blue; margin-block-start: auto;font-size: 1.5rem;\"></ion-icon>\r\n\r\n        </div>\r\n        <div class=\"filter-item-style\">\r\n            <input type=\"radio\" id=\"Nom\" name=\"filterType\" [checked]=\"(filterType=='name')\"\r\n                   value=\"name\" (click)=\"getFilterType('name')\" style=\"font-size: 4rem!important;\">\r\n            <label for=\"Nom\">\r\n                Nom/Prénom\r\n            </label>\r\n        </div>\r\n\r\n        <div class=\"filter-item-style\">\r\n            <input type=\"radio\" id=\"status\" name=\"filterType\" [checked]=\"(filterType=='status')\"\r\n                   value=\"status\" (click)=\"getFilterType('status')\" style=\"font-size: 4rem!important;\">\r\n            <label for=\"status\">\r\n                Statut\r\n            </label>\r\n        </div>\r\n        <div class=\"filter-item-style\">\r\n            <input type=\"radio\" id=\"phone\" name=\"filterType\" [checked]=\"(filterType=='phone')\"\r\n                   value=\"phone\" (click)=\"getFilterType('phone')\" style=\"font-size: 4rem!important;\">\r\n            <label for=\"phone\">\r\n                Téléphone\r\n            </label>\r\n        </div>\r\n\r\n        <div class=\"col-lg-7 form-control filter-item-style\" *ngIf=\"showFilterField && filterType\"\r\n             style=\"display: flex; flex-direction: row; margin-left: 0;\">\r\n            <label>\r\n                <input #searchInput\r\n                       (keyup)=\"searchProspect($event)\"\r\n                       [formControl]=\"searchControl\"\r\n                       [(ngModel)]=\"keyword\"\r\n                       placeholder=\"{{placeHolder}}\"\r\n                       [ngClass]=\"(isWeb) ? 'search-style-field' : 'search-style-field-mobile'\">\r\n            </label>\r\n        </div>\r\n\r\n    </div>\r\n    <div *ngIf=\"filters && showFiltre\" class=\"filtre\">\r\n        <africlean-filters [filters]=\"filters\" (emitChoice)=\"getFilters($event, '')\"\r\n                           (emitAdressFilter)=\"getFilters($event, 'adresse')\"\r\n                           (refreshEvent)=\"refresh()\">\r\n        </africlean-filters>\r\n    </div>\r\n\r\n    <div class=\"info-filter\" *ngIf=\"showFiltre\">\r\n\r\n        <div class=\"filters-used\" *ngIf=\"choice && choice.length != 0\">\r\n            <div class=\"filters-used\" *ngIf=\"adressToSearch\">\r\n\r\n                <div class=\"filters\">Adresse :</div>\r\n\r\n                <div>\r\n                    <span *ngIf=\"adressToSearch.country\"> {{ adressToSearch.country.countryName }} </span>\r\n                    <span *ngIf=\"adressToSearch.region\"> {{ adressToSearch.region.regionName }} </span>\r\n                    <span *ngIf=\"adressToSearch.commune\"> {{ adressToSearch.commune.nameOfTown  }} </span>\r\n                    <span *ngIf=\"adressToSearch.district\"> {{ adressToSearch.district.nameOfDistrict }} </span>\r\n                    <span *ngIf=\"adressToSearch.sector\"> {{ adressToSearch.sector.nameOfSector }} </span>\r\n                </div>\r\n\r\n            </div>\r\n\r\n            <div class=\"results\" *ngIf=\"prospections\">\r\n                <span>{{ prospections.length }}</span> résultat(s) trouvé(s)\r\n            </div>\r\n\r\n        </div>\r\n    </div>\r\n\r\n    <div [ngClass]=\"{\r\n    'container-web' : isWeb == true,\r\n    'container-mobile' : isWeb == false\r\n  }\">\r\n        <!-- Le titre du component -->\r\n        <div class=\"title\" *ngIf=\"action != 'update'\">\r\n            Liste des prospections\r\n        </div>\r\n        <div class=\"prospect-space\">\r\n            <div *ngIf=\"prospections\">\r\n                <app-africlean-display-prospection *ngFor=\"let prospect of prospections| paginate:\r\n                                            {\r\n                                               itemsPerPage: nbrProspectionPerPage,\r\n                                               currentPage: currentPage\r\n                                            }\"\r\n                                                   [theme]=\"'prospection'\"\r\n                                                   [prospection]=\"prospect\"\r\n                                                   [action]=\"action\"\r\n                                                   [isWeb]=\"isWeb\">\r\n\r\n                </app-africlean-display-prospection>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"pagination-controls\" [ngClass]=\"{\r\n      'pagination-controls-mobile-style': isWeb === false\r\n    }\">\r\n            <pagination-controls (pageChange)=\"sendPosition($event)\"\r\n                                 previousLabel=\"\"\r\n                                 nextLabel=\"\" *ngIf=\"prospections && action !== 'update'\">\r\n\r\n            </pagination-controls>\r\n        </div>\r\n\r\n        <!-- Bouton pour ajouter une nouvelle prospection -->\r\n        <div *ngIf=\"action != 'update'\">\r\n            <ion-fab vertical=\"bottom\" horizontal=\"center\" slot=\"fixed\" (click)=\"addProspect()\">\r\n                <ion-fab-button>\r\n                    <ion-icon name=\"add\"></ion-icon>\r\n                </ion-fab-button>\r\n            </ion-fab>\r\n        </div>\r\n\r\n        <div text-center *ngIf=\"!prospections\">\r\n            <ion-spinner></ion-spinner>\r\n        </div>\r\n\r\n    </div>\r\n\r\n    <div *ngIf=\"action == 'update'\">\r\n        <div>\r\n            <!-- Bouton de d'action-->\r\n            <ion-item *ngIf=\"resultList\">\r\n                <ion-label>\r\n                    Resultat\r\n                </ion-label>\r\n                <ion-select *ngIf=\"resultList\" (ionChange)=\"getResult($event)\">\r\n                    <ion-select-option *ngFor=\"let result of resultList\" value=\"{{result }}\">\r\n                        {{ result}}\r\n                    </ion-select-option>\r\n                </ion-select>\r\n            </ion-item>\r\n\r\n            <!-- Les raisons -->\r\n            <ion-item class=\"reason\">\r\n                <ion-textarea (ionChange)=\"getReasons($event)\"\r\n                              placeholder=\"commenter le resultat du prospect ici...\">\r\n                </ion-textarea>\r\n            </ion-item>\r\n        </div>\r\n\r\n        <div>\r\n            <ion-row>\r\n\r\n                <ion-col size=\"12\">\r\n\r\n                    <div class=\"separate\"></div>\r\n\r\n                    <africlean-small-button [theme]=\"'prospection'\"\r\n                                            [title]=\"'PAGES.REGISTRATION.CREATE_EMPLOYE' | translate\"\r\n                                            (clickButton)=\"updateProspection()\">\r\n                    </africlean-small-button>\r\n\r\n                </ion-col>\r\n\r\n            </ion-row>\r\n        </div>\r\n\r\n        <ion-item></ion-item>\r\n        <div *ngIf=\"prospections && prospections.length>0 && prospections[0].prospectResult\">\r\n            <ion-row>\r\n                <ion-col size=\"12\">\r\n                    <strong><u>Résultat:</u></strong> &nbsp;{{prospections[0].prospectResult}}\r\n                </ion-col>\r\n            </ion-row>\r\n\r\n            <ion-row>\r\n                <ion-col size=\"12\">\r\n                    <strong><u>Commentaire:</u></strong> &nbsp;{{prospections[0].commentResult}}\r\n                </ion-col>\r\n            </ion-row>\r\n        </div>\r\n    </div>\r\n    <div>\r\n    </div>\r\n\r\n</div>\r\n"

